window.bookSummaryJSON = "<p>\"Nothing good ever happens at the butt-crack of dawn. No doubt, the headless corpse on the autopsy table in front of me would agree.\" – Violet Parker </p> <p>Real estate agent Violet \"Spooky\" Parker stumbles upon a body-part theft ring at the local funeral parlor and suspects her caustic coworker has a hand in it - or maybe a foot. Can Violet discover what's in the crates that the crooks are sneaking out of the mortuary in the dark of night? Or will she end up in one of them herself - in pieces?</p>"; 
